import{_ as e,o as a,c as t,O as r}from"./chunks/framework.9482e208.js";const d=JSON.parse('{"title":"§ 23.1-1801 Membership.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/23.1-1801.md","filePath":"vacode/23.1-1801.md"}'),o={name:"vacode/23.1-1801.md"},i=r('<h1 id="§-23-1-1801-membership" tabindex="-1">§ 23.1-1801 Membership. <a class="header-anchor" href="#§-23-1-1801-membership" aria-label="Permalink to &quot;§ 23.1-1801 Membership.&quot;">​</a></h1><p>A. The board shall consist of 12 members appointed by the Governor, of whom at least nine shall be residents of the Commonwealth and at least six shall be alumni of the University.</p><p>B. The alumni association of the University may submit to the Governor a list of at least three nominees for each vacancy on the board, whether the vacancy occurs by expiration of a term or otherwise. The Governor may appoint a member from the list of nominees.</p><p>1972, c. 861, §§ 23-91.36, 23-91.37; 2004, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0176" target="_blank" rel="noreferrer">176</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0195" target="_blank" rel="noreferrer">195</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>.</p>',4),n=[i];function s(h,l,c,m,p,_){return a(),t("div",null,n)}const b=e(o,[["render",s]]);export{d as __pageData,b as default};
